import React from 'react';

function ContactPage() {
  return (
    <div className="container">
      <h1>Contact Me</h1>
      <p>Feel free to reach out on LinkedIn, GitHub, or Telegram. Let's connect!</p>
    </div>
  );
}

export default ContactPage;
